import React from 'react';
import Col1 from "../components/col1";
import Col2 from "../components/col2";
import Col3 from "../components/col3";
//This alone creates a function that we can use as a component
//Does not work when I use props: Lets use class. I like class more... Turns out he says using function components is better.

const Apartment = ( props ) => {
    //20 Mins to get to apmt
    props.addMinutes(20);
    return( 
        <>
        <Col1 BackImage = {madrid} backSize = {col1_back_size}>
          <h1 id="col_1_title"> MayVille </h1>
        </Col1>
        <Col2 BackImage = {Window_black_pink_flash}
        backSize = {col2_back_size} backRepeat = {col2_back_repeat} backPosition = {col2_back_position}>
            <p>
              You are <UserInputText changeFunction = {changeName}/> You live alone in a small apartment. You are currently unemployed and living from government checks. 
            </p>
            <p>One night you see a flash of light through your window.</p>
        </Col2>

        <Col3 
            backSize = {col3_back_size} backRepeat = {col3_back_repeat} backPosition = {col3_back_position} backHeight = {col3_back_height} backPosition = {col3_back_position}> 

            <button type="button" className="btn btn-primary" id ="_2_peek_button" onClick={_2_peek_button}>Take a closer look</button>
            <button type="button" className="btn btn-primary" id ="_2_ignore_it_button" onClick={_2_ignore_it_button}>Ignore it</button>
        </Col3>
        </>
    );

}

/*
<p id = "col_1_stats"> Energy: ${main_character.energy} &nbsp &nbsp &nbsp Lust: ${main_character.lust} &nbsp &nbsp &nbsp &nbsp &nbsp ${game_date.toString().slice(0,21)} &nbsp &nbsp &nbsp cash: $${main_character.money}</p>
*/

export default Apartment;
